import React, { useState } from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { CSSTransition } from 'react-transition-group';
import Page1 from './Page1.js';
import Page2 from './Page2.js';
import Page3 from './Page3.js';
import Page4 from './Page4.js';
import Page5 from './Page5.js';

function App() {
  const [inputValue1, setInputValue1] = useState('');
  const [inputValue2, setInputValue2] = useState('');
  const [inputValue3, setInputValue3] = useState('');
  const [emailValue, setEmailValue] = useState('');
  const [showPage4, setShowPage4] = useState(false);

  return (
    <Router>
      <div className="App">
        <Routes>
          <Route
            path="/"
            element={
              <CSSTransition
                in={true}
                timeout={1000}
                classNames="page"
                unmountOnExit
              >
                <Page1 inputValue1={inputValue1} setInputValue1={setInputValue1} />
              </CSSTransition>
            }
          />
          <Route
            path="/hoşgeldiniz2"
            element={
              <CSSTransition
                in={true}
                timeout={1000}
                classNames="page"
                unmountOnExit
              >
                <Page2 inputValue2={inputValue2} setInputValue2={setInputValue2} />
              </CSSTransition>
            }
          />
          <Route
            path="/hoşgeldiniz3"
            element={
              <CSSTransition
                in={true}
                timeout={1000}
                classNames="page"
                unmountOnExit
              >
                <Page3 inputValue3={inputValue3} setInputValue3={setInputValue3} />
              </CSSTransition>
            }
          />
          <Route
            path="/hoşgeldiniz4"
            element={
              <CSSTransition
                in={true}
                timeout={1000}
                classNames="page"
                unmountOnExit
              >
                <Page4
                  inputValue1={inputValue1}
                  inputValue2={inputValue2}
                  inputValue3={inputValue3}
                  emailValue={emailValue}
                  setEmailValue={setEmailValue}
                />
              </CSSTransition>
            }
          />
          <Route
            path="/hoşgeldiniz5"
            element={
              <CSSTransition
                in={true}
                timeout={1000}
                classNames="page"
                unmountOnExit
              >
                <Page5 />
              </CSSTransition>
            }
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
